import React from "react";
import Navbar from "../Common/navbar";
import "../Common/style.css";
import img01 from '../Assestes/2.png'
function MenuPage() {
  return (
    <>
      <Navbar />
      <div className="product">
        
        <div className="items">
          <div className="child">
            <div className="img">
              <img src={img01} alt="img01" />
            </div>
            <div className="text">
              <h3>coffee name</h3>
            </div>
          </div>
          
        </div>
      </div>
    </>
  );
}

export default MenuPage;
